def get():
    headers = {
        'Host': 'wenshu.court.gov.cn',
        'Referer': 'http://wenshu.court.gov.cn/list/list/',
        'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.132 Safari/537.36',
    }

    session = requests.session()

    resp = session.get('http://wenshu.court.gov.cn/list/list/', headers=headers)
    html = resp.text
    func = re.compile("eval\((.*?split\('\|'\),0,{}\))\)").findall(html)[0]
    func = func.replace("return p", "return p.replace('HXXTTKKLLPPP5();', '')")
    func = 'function getFunction(){ var ff = %s; return ff;}' % func
    # print(func)

    js = execjs.compile(func)
    new_js_code = js.call('getFunction')
    new_js_code = new_js_code + js_code

    # print(new_js_code)
    js = execjs.compile(new_js_code)
    data = js.call('getCookie')
    # print(data)

    location_href = 'http://wenshu.court.gov.cn' + data['location']
    session.cookies.set('wzwstemplate', data['wzwstemplate'])
    session.cookies.set('wzwschallenge', data['wzwschallenge'])

    html = session.get(location_href, headers=headers, allow_redirects=False)
    # print(html.headers['Location'])
    resp = session.get('http://wenshu.court.gov.cn/list/list/', headers=headers)
    # print(resp.text)
    # print('...........')
    a = requests.utils.dict_from_cookiejar(resp.cookies)['vjkl5']
    session.close()
    return a


def createGuid():
    return str(hex((int(((1 + random.random()) * 0x10000)) | 0)))[3:]


def getguid():
    return '{}{}-{}-{}{}-{}{}{}' \
        .format(
        createGuid(), createGuid(),
        createGuid(), createGuid(),
        createGuid(), createGuid(),
        createGuid(), createGuid()
    )


def get_docid(result):
    result = eval(json.loads(result))
    runeval = result[0]['RunEval']
    content = result[1:]
    for i in content:
        casewenshuid = i.get('文书ID', '')
        doc_id = decrypt_id(runeval, casewenshuid)
        print('*******************  ---- %s' % doc_id)


def decrypt_id(RunEval, id):
    """
    docid解密
    """
    js = ctx3.call("GetJs", RunEval)
    js_objs = js.split(";;")
    js1 = js_objs[0] + ';'
    js2 = re.findall(r"_\[_\]\[_\]\((.*?)\)\(\);", js_objs[1])[0]
    key = ctx3.call("EvalKey", js1, js2)
    key = re.findall(r"\"([0-9a-z]{32})\"", key)[0]
    docid = ctx3.call("DecryptDocID", key, id)
    return docid


